scopecontent.p:
Het archiefblok heeft betrekking op de taakstelling en uitvoering van de VI. Er bevindt zich neerslag met betrekking tot:


vleeskeuring;


destructie;

zoönosen en voedselvergiftiging;

milieuhygiëne en residuen;

invoer van vlees;

diergeneesmiddelen;

dierproeven;


Goede Laboratorium Praktijk (GLP).

